1=Intelligence reports indicate the Soviets are researching deadly bio-chemical 
2=weapons. This secret soviet base is heavily guarded. Your first objective is 
3=to infiltrate the closest Radar Dome with a spy. Doing this should reveal the 
4=area were the Bio labs are located. Your second objective is to destroy the 
5=Bio labs. The Labs must be destroyed at all costs. Once they are destroyed 
6=your mission is complete. Reinforcments will be provided.
